import base64
from io import BytesIO

import torch
from download_models import test_after_1st_time
from PIL import Image

# page 2 of the transformers paper
images = [
    ""
]
queries = ["What does the transformer achieve?"]


model, processor = test_after_1st_time()


def get_example_score():
    image = images[0]
    img_data = base64.b64decode(image)
    img = Image.open(BytesIO(img_data))
    img = [img.convert("RGB")]

    batch_images = processor.process_images(img).to(model.device)
    batch_queries = processor.process_queries(queries).to(model.device)

    with torch.no_grad():
        image_embeddings = model(**batch_images)
        query_embeddings = model(**batch_queries)

    scores = processor.score_multi_vector(query_embeddings, image_embeddings)
    return scores


if __name__ == "__main__":
    scores = get_example_score()
    print(scores)
    print("done")
